import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Divider from '@material-ui/core/Divider';
import Logo from '../main_ver2/logo';
import login from '../../static/login.png';

const useStyles = makeStyles((theme) => ({
    root: {
        textAlign:'left',
    },
    div: {
        backgroundColor: 'rgba(107, 186, 167, 0.5)',
        height: '70%',
    },
    container: {
        padding: 0,
        height:'100%',
    },
    gridContainer: {
        marginTop: theme.spacing(4),
        height:'100%',
    },
    gridItem: {
        // border: 'solid',
    },
    card: {
        backgroundColor: 'rgba(255,255,255,0.4)',
        height:'80%',
        marginTop: theme.spacing(6),
        borderRadius: '4px',
        width: '60%',
        boxShadow:'1px 1px 4px grey',
        padding: theme.spacing(2)
    }
}));

export default function Login() {
    const classes = useStyles();

    return (
        <Box height={900} className={classes.root}>
            <Logo />
            <div className={classes.div}>
                <Container className={classes.container}>
                    <Grid container direction="row" justify="center" alignItems="stretch" className={classes.gridContainer}>
                        <Grid item xs={7} className={classes.gridItem}>
                            {/* <img src={login} width='50%' /> */}
                        </Grid>

                        <Grid item xs={5} className={classes.gridItem}>
                            <div className={classes.card} id='login'>
                                <div style={{fontSize:'30px',}}>Login</div>
                                <div style={{fontSize:'8px', color:'#999'}}>Welcome. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</div>
                            </div>
                        </Grid>
                    </Grid>
                </Container>
            </div>
        </Box>
    );
}
